import './App.css';
import HomePage from "./Components/HomePage";
import EmployeePage from './Components/EmployeePage';




function App () { 
  return (
    <div className='App'>
      <h1> Employee list</h1>
          <HomePage />
          <EmployeePage />
          <EmployeeDetail />
          <Header />
          <EmployeeList />
          <EmployeeListItem />
          <SearchBar />

    </div>
  );
    }

export default App;
